import React from 'react';

const Menu = ({items}) => {
  return (
    <div className="section-center">
      {items.map(menuItem => {
        const {id, title, image, des} = menuItem;

        return <article key={id} className="menu-item">
          <h2>{title}</h2>
        </article>
      })}
    </div>
  )
};

export default Menu;
